import React, {Component} from 'react';
import Team from "./Team";

class Teams extends Component {
    render() {
        return (
            <div className="teambuild">
                <Team bophan="kd" anhteam="img/team2.jpg" ten="UNKNOW" vitri="Kế toán" mota="Quản lý ngân sách dự án"/>
                <Team bophan="leader" anhteam="img/teamleader.jpg" ten="ANH NV" vitri="UI/UX" mota="Phân tích hệ thống, xây dựng giao diện"/>
                <Team bophan="nv" anhteam="img/team4.png" ten="VIỆT ND" vitri="Developer" mota="Xử lý server - cơ sở dữ liệu"/>
                <Team bophan="nv" anhteam="img/team5.png" ten="CƯƠNG NB" vitri="Developer" mota="Xử lý server - cơ sở dữ liệu"/>
                <Team bophan="nv" anhteam="img/team5.png" ten="THÀNH ĐT" vitri="Tư Vấn" mota="Xử lý server - cơ sở dữ liệu"/>
                <Team bophan="nv" anhteam="img/team6.png" ten="LAM NT" vitri="Developer" mota="Xử lý server - cơ sở dữ liệu"/>
            </div>
        );
    }
}

export default Teams;
